function mkid() { return Math.random().toString(36).slice(2,9); }
function makeStaffById(staff) { return Object.fromEntries(staff.map(s=>[s.id,s])); }
function buildShifts(staff, ftSchedule) {
  // New weeks start with full-timers pre-populated only.
  // Casuals are suggested via "Available · Not Scheduled" but not auto-added.
  const activeIds = new Set((staff||INITIAL_STAFF).filter(s=>s.active!==false).map(s=>s.id));
  const ftIds = new Set((staff||INITIAL_STAFF).filter(s=>s.type==="fulltime"&&s.active!==false).map(s=>s.id));
  const schedule = ftSchedule || INITIAL_FT_SCHEDULE;
  // Only include ft entries (not casual ca* entries)
  return schedule
    .filter(e => ftIds.has(e.staffId) && activeIds.has(e.staffId) && String(e.id).startsWith("ft"))
    .map(e => ({ ...e, id: mkid() }));
}

function getWeekDates(offset) {
  const now = new Date();
  const mon = new Date(now);
  mon.setDate(now.getDate() - ((now.getDay()+6)%7) + offset*7);
  return DAYS.map((_,i) => { const d = new Date(mon); d.setDate(mon.getDate()+i); return d; });
}
function fmtDate(d) { return d.toLocaleDateString("en-AU",{day:"numeric",month:"short"}); }
function fmtDateNum(d) { return d.toLocaleDateString("en-AU",{day:"numeric",month:"numeric"}); }

