// ─── AUTO-SCHEDULE HELPERS ────────────────────────────────────────────────────

// Minimum staffing rules per location per day
const LOCATION_RULES = {
  "Mama Vu's Kitchen": [
    { role:"Chef",         min:2 },
    { role:"Kitchen Crew", min:1 },
    { role:"Cashier",      min:1 },
  ],
  "Nicks Thai": [
    { role:"Waiter",       min:1 },
    { role:"Chef",         min:2 },
    { role:"Cashier",      min:1 }, // or Site Manager
  ],
  "The Pit": [
    { role:"Kitchen Crew", min:2 },
  ],
};

function autoScheduleCasuals(dayShort, currentShifts, staff, ftSchedule) {
  // Start from existing shifts
  let shifts = [...currentShifts];
  const scheduled = new Set(shifts.map(s => s.staffId));
  const activeStaff = staff.filter(s => s.active !== false);

  // Available casuals for this day (not yet scheduled)
  const avail = activeStaff.filter(s =>
    s.type === "casual" &&
    (s.av[dayShort] || Object.keys(s.av).length === 0) &&
    !scheduled.has(s.id)
  );

  // Helper: how many of a role are already at a location for this day
  const countRole = (loc, role) => {
    const staffById = makeStaffById(activeStaff);
    const owners = shifts.filter(sh => sh.day === dayShort && sh.location === loc &&
      staffById[sh.staffId]?.role === "Owner").length;
    return shifts.filter(sh => sh.day === dayShort && sh.location === loc &&
      (staffById[sh.staffId]?.role === role || (role !== "Owner" && staffById[sh.staffId]?.role === "Owner"))
    ).length;
  };

  const addShift = (member, loc) => {
    const s = { id: mkid(), staffId: member.id, day: dayShort, start: "9:00 AM", end: "5:00 PM", location: loc };
    shifts.push(s);
    scheduled.add(member.id);
  };

  const pickAvail = (role) => {
    // Try exact role first, then Owner as fallback
    let found = avail.find(s => !scheduled.has(s.id) && s.role === role);
    if (!found) found = avail.find(s => !scheduled.has(s.id) && s.role === "Owner");
    return found;
  };

  // Fill minimum requirements per location
  for (const [loc, rules] of Object.entries(LOCATION_RULES)) {
    for (const rule of rules) {
      const need = rule.min;
      // Count existing + just-added for this rule
      const staffById = makeStaffById(activeStaff);
      let have = shifts.filter(sh =>
        sh.day === dayShort && sh.location === loc &&
        (staffById[sh.staffId]?.role === rule.role || staffById[sh.staffId]?.role === "Owner")
      ).length;
      while (have < need) {
        const candidate = avail.find(s =>
          !scheduled.has(s.id) && (s.role === rule.role || s.role === "Owner")
        );
        if (!candidate) break;
        addShift(candidate, loc);
        have++;
      }
    }
  }

  // Give every remaining available casual at least 1 shift
  // Place them where they have a CASUAL_DEFAULTS entry, otherwise round-robin locations
  const locCycle = [...LOCATIONS];
  let locIdx = 0;
  for (const member of avail) {
    if (scheduled.has(member.id)) continue;
    const defaultEntry = CASUAL_DEFAULTS.find(d => d.staffId === member.id && d.day === dayShort);
    const loc = defaultEntry ? defaultEntry.location : locCycle[locIdx++ % locCycle.length];
    addShift(member, loc);
  }

  return shifts;
}

