// ─── DRAWER FADE — scroll-reveal gradient overlay ────────────────────────────
function DrawerFade({ children, bg="#0d1117" }) {
  const [prog, setProg] = useState(0);
  const [isScrollable, setIsScrollable] = useState(false);
  const onScroll = (e) => {
    const el = e.currentTarget;
    const scrollable = el.scrollHeight - el.clientHeight;
    // Only treat as scrollable if there's more than 4px of overflow (avoids desktop rounding)
    if (scrollable > 4) {
      setIsScrollable(true);
      setProg(Math.min(el.scrollTop / scrollable, 1));
    } else {
      setIsScrollable(false);
      setProg(1);
    }
  };
  // Measure on mount and resize
  const ref = useRef(null);
  useEffect(() => {
    const check = () => {
      if (ref.current) {
        const scrollable = ref.current.scrollHeight - ref.current.clientHeight;
        setIsScrollable(scrollable > 4);
        if (scrollable <= 4) setProg(1);
      }
    };
    check();
    const ro = new ResizeObserver(check);
    if (ref.current) ro.observe(ref.current);
    return () => ro.disconnect();
  }, [children]);
  const child = React.Children.only(children);
  const gradHeight = "0%"; // gradient removed from main screen
  return (
    <div style={{position:"relative", height:"100%", overflow:"hidden"}}>
      {React.cloneElement(child, { ref, onScroll, style: {...(child.props.style||{}), height:"100%", overflowY:"auto"} })}
      <div style={{
        position:"absolute", bottom:0, left:0, right:0,
        height:gradHeight,
        background:`linear-gradient(to bottom, transparent 0%, ${bg}cc 55%, ${bg} 100%)`,
        pointerEvents:"none",
        transition:"height 0.2s ease",
      }}/>
    </div>
  );
}


// ─── SWIPE TO DELETE ──────────────────────────────────────────────────────────
function SwipeToDelete({ onDelete, confirmRequired, confirmMessage, children }) {
  const [swipeX, setSwipeX] = React.useState(0);
  const [showConfirm, setShowConfirm] = React.useState(false);
  const [collapsing, setCollapsing] = React.useState(false);
  const swipeXRef = React.useRef(0);
  const isDragging = React.useRef(false);
  const startX = React.useRef(null);
  const startY = React.useRef(null);
  const wrapRef = React.useRef(null);
  const onDeleteRef = React.useRef(onDelete);
  React.useEffect(() => { onDeleteRef.current = onDelete; }, [onDelete]);
  const threshold = 68;

  const setX = (v) => { swipeXRef.current = v; setSwipeX(v); };
  const reset = () => { setX(0); setShowConfirm(false); };

  const doDelete = React.useCallback(() => {
    setX(-420);
    setTimeout(() => {
      setCollapsing(true);
      setTimeout(() => onDeleteRef.current(), 350);
    }, 200);
  }, []);

  React.useEffect(() => {
    const el = wrapRef.current;
    if (!el) return;
    const onStart = (e) => {
      startX.current = e.touches[0].clientX;
      startY.current = e.touches[0].clientY;
      isDragging.current = true;
    };
    const onMove = (e) => {
      if (!isDragging.current) return;
      const dx = e.touches[0].clientX - startX.current;
      const dy = e.touches[0].clientY - startY.current;
      if (Math.abs(dx) > Math.abs(dy) + 5 && dx < 0) {
        e.preventDefault();
        setX(Math.max(dx, -380));
      } else if (Math.abs(dy) > Math.abs(dx) + 5) {
        // clearly scrolling vertically — cancel swipe
        isDragging.current = false;
        setX(0);
      }
    };
    const onEnd = () => {
      if (!isDragging.current) return;
      isDragging.current = false;
      const cur = swipeXRef.current;
      startX.current = null;
      if (cur < -threshold) {
        if (confirmRequired) { setX(-110); setShowConfirm(true); }
        else { doDelete(); }
      } else { setX(0); }
    };
    el.addEventListener("touchstart", onStart, { passive: true });
    el.addEventListener("touchmove", onMove, { passive: false });
    el.addEventListener("touchend", onEnd, { passive: true });
    el.addEventListener("touchcancel", onEnd, { passive: true });
    return () => {
      el.removeEventListener("touchstart", onStart);
      el.removeEventListener("touchmove", onMove);
      el.removeEventListener("touchend", onEnd);
      el.removeEventListener("touchcancel", onEnd);
    };
  }, [confirmRequired, doDelete]);

  return (
    <>
      {/* Outer: handles collapse animation (no overflow:hidden so content isn't clipped) */}
      <div
        ref={wrapRef}
        style={{
          maxHeight: collapsing ? 0 : 500,
          opacity: collapsing ? 0 : 1,
          overflow: "hidden",
          transition: collapsing
            ? "max-height 0.35s cubic-bezier(0.4,0,0.2,1), opacity 0.3s ease"
            : "none",
        }}
      >
        {/* Inner: clips the red delete bg to border radius */}
        <div style={{ position: "relative", borderRadius: 12, overflow: "hidden" }}>
          {/* Red bg */}
          <div style={{
            position:"absolute", inset:0,
            background:"linear-gradient(90deg, transparent 0%, #ef444422 40%, #ef4444cc 100%)",
            display:"flex", alignItems:"center", justifyContent:"flex-end",
            paddingRight:18, pointerEvents:"none",
            opacity: Math.min(1, Math.abs(swipeX) / threshold),
            borderRadius:12,
          }}>
            <span style={{fontSize:20}}>🗑</span>
          </div>
          {/* Sliding content */}
          <div style={{
            transform: `translateX(${swipeX}px)`,
            transition: isDragging.current ? "none" : "transform 0.3s cubic-bezier(0.25,1,0.5,1)",
            willChange: "transform",
            position: "relative",
          }}>
            {children}
          </div>
        </div>
      </div>
      {showConfirm && (
        <ConfirmDeleteModal
          onConfirm={() => { setShowConfirm(false); doDelete(); }}
          onCancel={reset}
          message={confirmMessage}
        />
      )}
    </>
  );
}

