function DayScreen({ dayShort, shifts, setShifts, weekOffset, onBack, staff, ftSchedule }) {
  const [modal, setModal] = useState(null);
  const staffById = makeStaffById(staff||INITIAL_STAFF);
  const idx = DAY_SHORT.indexOf(dayShort);
  const dayFull = DAYS[idx];
  const weekDates = getWeekDates(weekOffset);
  const dayShifts = shifts.filter(s=>s.day===dayShort);

  const remove = (id) => setShifts(p=>p.filter(s=>s.id!==id));
  const save = ({staffId,start,end,location}) => {
    if(modal.mode==="edit") setShifts(p=>p.map(s=>s.id===modal.shift.id?{...s,start,end,location}:s));
    else setShifts(p=>[...p,{id:mkid(),staffId,day:dayShort,start,end,location,role:staffById[staffId]?.role}]);
    setModal(null);
  };



  // Group by location
  const byLoc = LOCATIONS.map(loc=>({
    loc,
    shifts: dayShifts.filter(s=>s.location===loc).sort((a,b)=>a.start.localeCompare(b.start))
  })).filter(g=>g.shifts.length>0);

  return (
    <div style={{minHeight:"100vh",background:"#09090f",display:"flex",flexDirection:"column"}}>
      <div style={{background:"#0d1117",borderBottom:"1px solid #1e293b",padding:"14px 18px",display:"flex",alignItems:"center",gap:12,flexShrink:0}}>
        <button onClick={onBack} style={{background:"#1e293b",border:"none",borderRadius:9,padding:"7px 12px",color:"#94a3b8",fontSize:16,cursor:"pointer",display:"flex",alignItems:"center",justifyContent:"center",width:34,height:34}}><span style={{display:"inline-block",transform:"rotate(-90deg)",lineHeight:1}}>‹</span></button>
        <div style={{flex:1}}>
          <div style={{fontSize:18,fontWeight:700,color:"#f1f5f9",fontFamily:"'DM Sans',sans-serif"}}>{dayFull}</div>
          <div style={{fontSize:11,color:"#475569",fontFamily:"'DM Mono',monospace"}}>{fmtDate(weekDates[idx])}</div>
        </div>
        <button onClick={()=>setModal({mode:"add"})} style={{background:`linear-gradient(135deg,${CA},#6d28d9)`,border:"none",borderRadius:9,padding:"8px 14px",color:"#fff",fontFamily:"'DM Mono',monospace",fontSize:12,fontWeight:600,cursor:"pointer"}}>+ Add</button>
      </div>

      <div style={{flex:1,overflowY:"auto",padding:"16px 14px 32px"}}>
        {/* By location */}
        {byLoc.map(({loc,shifts:ls})=>{
          const lc = LOC_COLORS[loc]||{bg:"#111",border:"#333",accent:"#888"};
          return (
            <div key={loc} style={{marginBottom:20}}>
              <div style={{display:"flex",alignItems:"center",gap:8,marginBottom:10,paddingLeft:2}}>
                <div style={{width:3,height:16,borderRadius:2,background:lc.accent}}/>
                <div style={{fontSize:12,fontWeight:700,color:lc.accent,fontFamily:"'DM Sans',sans-serif"}}>{loc}</div>
                <div style={{fontSize:10,color:"#334155",fontFamily:"'DM Mono',monospace"}}>{ls.length} shift{ls.length!==1?"s":""}</div>
              </div>
              <div style={{display:"flex",flexDirection:"column",gap:7}}>
                {ls.map(sh=>{
                  const s = staffById[sh.staffId];
                  if(!s) return null;
                  const isFT = s.type==="fulltime";
                  const sc = isFT?FT:CA;
                  // Availability conflict: for casuals check av map; for FT check ftSchedule (any entry for this day = available)
                  const avWarnCasual = !isFT && s.av && Object.keys(s.av).length > 0 && !s.av[dayShort];
                  const avWarnFT = isFT && (ftSchedule||INITIAL_FT_SCHEDULE).filter(e=>e.staffId===s.id).length > 0 && !(ftSchedule||INITIAL_FT_SCHEDULE).some(e=>e.staffId===s.id&&e.day===dayShort);
                  const avWarn = avWarnCasual || avWarnFT;
                  const avWarnColor = avWarnFT ? "#ef4444" : "#f59e0b";
                  return (
                    <SwipeToDelete key={sh.id} onDelete={()=>remove(sh.id)} confirmRequired={isFT}>
                      <div style={{background:lc.bg,border:`1px solid ${avWarn?avWarnColor+"66":lc.border+"33"}`,borderLeft:`3px solid ${avWarn?avWarnColor:sc}`,borderRadius:10,padding:"11px 14px",display:"flex",alignItems:"center",gap:10}}>
                        <Avatar name={s.name} type={s.type} size={36} staffId={s.id} picOverride={s.pic}/>
                        <div style={{flex:1,minWidth:0}}>
                          <div style={{fontSize:13,fontWeight:700,color:"#e2e8f0",fontFamily:"'DM Sans',sans-serif",overflow:"hidden",textOverflow:"ellipsis",whiteSpace:"nowrap"}}>{s.name}</div>
                          <div style={{fontSize:10,color:"#64748b",fontFamily:"'DM Mono',monospace"}}>{s.role} · {sh.start}–{sh.end}</div>
                          {isFT&&<div style={{fontSize:9,color:FT,fontFamily:"'DM Mono',monospace",marginTop:1}}>Full-time</div>}
                          {avWarn&&<div style={{fontSize:9,color:avWarnColor,fontFamily:"'DM Mono',monospace",marginTop:2,display:"flex",alignItems:"center",gap:3}}><span>⚠</span><span>N/A {dayShort}</span></div>}
                        </div>
                        <button onClick={(e)=>{e.stopPropagation();setModal({mode:"edit",shift:sh});}} style={{background:"rgba(255,255,255,.06)",border:"1px solid #334155",borderRadius:7,padding:"5px 9px",color:"#64748b",fontSize:10,fontFamily:"'DM Mono',monospace",cursor:"pointer"}}>Edit</button>
                      </div>
                    </SwipeToDelete>
                  );
                })}
              </div>
            </div>
          );
        })}

        {byLoc.length===0&&<div style={{textAlign:"center",padding:"48px 0",color:"#334155",fontFamily:"'DM Mono',monospace",fontSize:12}}>No shifts yet — tap + Add to assign staff</div>}

        {/* Available unscheduled */}
        {(()=>{
          const sched = new Set(dayShifts.map(s=>s.staffId));
          const unsched = (staff||INITIAL_STAFF).filter(s=>s.active!==false&&s.av[dayShort]&&!sched.has(s.id));
          if(!unsched.length) return null;
          return (
            <div style={{marginTop:20}}>
              <div style={{fontSize:10,color:"#334155",fontFamily:"'DM Mono',monospace",letterSpacing:1,marginBottom:10,paddingLeft:2}}>AVAILABLE · NOT SCHEDULED</div>
              <div style={{display:"flex",flexWrap:"wrap",gap:7}}>
                {unsched.map(s=>(
                  <button key={s.id} onClick={()=>setModal({mode:"add",staffId:s.id})} style={{background:"#12121e",border:"1px dashed #1e293b",borderRadius:9,padding:"8px 10px",display:"flex",alignItems:"center",gap:7,cursor:"pointer",transition:"border-color .15s"}}
                    onMouseEnter={e=>e.currentTarget.style.borderColor=CA}
                    onMouseLeave={e=>e.currentTarget.style.borderColor="#1e293b"}
                  >
                    <Avatar name={s.name} type={s.type} size={24} staffId={s.id} picOverride={s.pic}/>
                    <div style={{textAlign:"left"}}>
                      <div style={{fontSize:11,color:"#94a3b8",fontFamily:"'DM Sans',sans-serif",lineHeight:1.2}}>{s.name}</div>
                      <div style={{fontSize:9,color:"#475569",fontFamily:"'DM Mono',monospace"}}>{s.role}</div>
                    </div>
                    <span style={{color:CA,fontSize:13}}>+</span>
                  </button>
                ))}
              </div>
            </div>
          );
        })()}
      </div>

      {modal&&<ShiftModal shift={modal.mode==="edit"?modal.shift:null} staffId={modal.staffId} day={dayFull} lockStaff={false} staff={staff} onClose={()=>setModal(null)} onSave={save}/>}
    </div>
  );
}

