const ROLES = ["Waiter","Kitchen Crew","Chef","Cashier","Site Manager","Dishy","Bar Staff"];
const DAYS_FULL = ["Mon","Tue","Wed","Thu","Fri","Sat","Sun"];


// ─── ROLE CHIP SELECTOR ───────────────────────────────────────────────────────
const BASE_ROLES = ["Waiter","Kitchen Crew","Chef","Cashier","Site Manager","Dishy","Bar Staff"];

function RoleChipSelector({ editRole, setEditRole }) {
  const inputRef = useRef(null);
  const selected = editRole ? editRole.split(" / ").filter(Boolean) : [];

  const toggle = (r) => {
    const next = selected.includes(r) ? selected.filter(x=>x!==r) : [...selected, r];
    setEditRole(next.join(" / "));
  };

  const commitCustom = () => {
    const val = inputRef.current?.value?.trim();
    if (!val) return;
    if (!selected.includes(val)) {
      setEditRole([...selected, val].join(" / "));
    }
    if (inputRef.current) inputRef.current.value = "";
  };

  return (
    <div>
      <div style={{fontSize:10,color:"#475569",fontFamily:"'DM Mono',monospace",letterSpacing:1,marginBottom:8}}>ROLE</div>
      <div style={{display:"flex",flexWrap:"wrap",gap:6,alignItems:"center"}}>
        {BASE_ROLES.map(r=>{
          const on = selected.includes(r);
          return (
            <button key={r} onClick={()=>toggle(r)} style={{
              padding:"6px 11px", borderRadius:20, fontSize:11, cursor:"pointer",
              fontFamily:"'DM Mono',monospace",
              background: on ? CA+"33" : "#0f172a",
              border: on ? `1px solid ${CA}88` : "1px solid #1e293b",
              color: on ? "#c4b5fd" : "#475569",
              transition:"all .15s",
              display:"flex", alignItems:"center", gap:5,
            }}>
              {on && <span style={{fontSize:10,color:"#7c3aed",fontWeight:700,lineHeight:1}}>×</span>}
              {r}
            </button>
          );
        })}
        {/* Custom chips already added */}
        {selected.filter(r=>!BASE_ROLES.includes(r)).map(r=>(
          <button key={r} onClick={()=>toggle(r)} style={{
            padding:"6px 11px", borderRadius:20, fontSize:11, cursor:"pointer",
            fontFamily:"'DM Mono',monospace",
            background: CA+"33", border:`1px solid ${CA}88`, color:"#c4b5fd",
            display:"flex", alignItems:"center", gap:5, transition:"all .15s",
          }}>
            <span style={{fontSize:10,color:"#7c3aed",fontWeight:700,lineHeight:1}}>×</span>
            {r}
          </button>
        ))}
        {/* Custom role input */}
        <div style={{display:"inline-flex",overflow:"hidden",borderRadius:20,border:"1px dashed #334155",background:"#0f172a"}}>
          <input
            ref={inputRef}
            placeholder="+"
            onKeyDown={e=>{
              if(e.key==="Enter"||e.key==="Done"){
                e.preventDefault();
                commitCustom();
                e.target.blur();
              }
            }}
            onBlur={commitCustom}
            style={{
              background:"transparent", border:"none",
              padding:"3px 8px", color:"#94a3b8",
              fontSize:16,
              fontFamily:"'DM Mono',monospace", outline:"none",
              width:50,
              transform:"scale(0.6875)",
              transformOrigin:"left center",
              marginRight:"-16px",
            }}
          />
        </div>
      </div>
    </div>
  );
}

