// ─── IMAGE CROP MODAL ────────────────────────────────────────────────────────
function ImageCropModal({ imageSrc, onConfirm, onCancel }) {
  const canvasRef = React.useRef(null);
  const [imgEl, setImgEl] = React.useState(null);
  const [offset, setOffset] = React.useState({ x: 0, y: 0 });
  const [scale, setScale] = React.useState(1);
  const [dragging, setDragging] = React.useState(false);
  const lastPos = React.useRef(null);
  const lastPinchDist = React.useRef(null);
  const containerSize = 280; // square crop window

  // Load image
  React.useEffect(() => {
    const img = new Image();
    img.onload = () => {
      // Fit image to fill the crop square initially
      const fitScale = Math.max(containerSize / img.width, containerSize / img.height);
      setScale(fitScale);
      setOffset({ x: (containerSize - img.width * fitScale) / 2, y: (containerSize - img.height * fitScale) / 2 });
      setImgEl(img);
    };
    img.src = imageSrc;
  }, [imageSrc]);

  // Draw canvas whenever state changes
  React.useEffect(() => {
    if (!imgEl || !canvasRef.current) return;
    const ctx = canvasRef.current.getContext("2d");
    const cx = containerSize / 2, cy = containerSize / 2, r = containerSize / 2 - 2;

    // 1. Black background so no transparency shows
    ctx.fillStyle = "#000";
    ctx.fillRect(0, 0, containerSize, containerSize);

    // 2. Draw image clipped to circle (no alpha bleeding)
    ctx.save();
    ctx.beginPath();
    ctx.arc(cx, cy, r, 0, Math.PI * 2);
    ctx.clip();
    ctx.drawImage(imgEl, offset.x, offset.y, imgEl.width * scale, imgEl.height * scale);
    ctx.restore();

    // 3. Dark overlay outside circle — drawn as a path with a hole (even-odd rule)
    ctx.save();
    ctx.fillStyle = "rgba(0,0,0,0.62)";
    ctx.beginPath();
    ctx.rect(0, 0, containerSize, containerSize);
    ctx.arc(cx, cy, r, 0, Math.PI * 2, true); // true = counterclockwise = hole
    ctx.fill("evenodd");
    ctx.restore();

    // 4. Circle border
    ctx.strokeStyle = "#7c3aed";
    ctx.lineWidth = 2;
    ctx.beginPath();
    ctx.arc(cx, cy, r, 0, Math.PI * 2);
    ctx.stroke();
  }, [imgEl, offset, scale]);

  // No clamping — full freedom to pan anywhere
  const freeOffset = (x, y) => ({ x, y });

  // Mouse events
  const onMouseDown = (e) => { setDragging(true); lastPos.current = { x: e.clientX, y: e.clientY }; };
  const onMouseMove = (e) => {
    if (!dragging) return;
    const dx = e.clientX - lastPos.current.x;
    const dy = e.clientY - lastPos.current.y;
    lastPos.current = { x: e.clientX, y: e.clientY };
    setOffset(o => freeOffset(o.x + dx, o.y + dy));
  };
  const onMouseUp = () => setDragging(false);

  // Touch events
  const onTouchStart = (e) => {
    if (e.touches.length === 1) {
      lastPos.current = { x: e.touches[0].clientX, y: e.touches[0].clientY };
    } else if (e.touches.length === 2) {
      const dx = e.touches[0].clientX - e.touches[1].clientX;
      const dy = e.touches[0].clientY - e.touches[1].clientY;
      lastPinchDist.current = Math.hypot(dx, dy);
    }
  };
  const onTouchMove = (e) => {
    e.preventDefault();
    if (e.touches.length === 1 && lastPos.current) {
      const dx = e.touches[0].clientX - lastPos.current.x;
      const dy = e.touches[0].clientY - lastPos.current.y;
      lastPos.current = { x: e.touches[0].clientX, y: e.touches[0].clientY };
      setOffset(o => freeOffset(o.x + dx, o.y + dy));
    } else if (e.touches.length === 2 && lastPinchDist.current) {
      const t0 = e.touches[0], t1 = e.touches[1];
      const dx = t0.clientX - t1.clientX;
      const dy = t0.clientY - t1.clientY;
      const dist = Math.hypot(dx, dy);
      const rawDelta = dist / lastPinchDist.current;
      const delta = rawDelta > 1
        ? 1 + (rawDelta - 1) * 0.45
        : 1 - (1 - rawDelta) * 0.45;
      lastPinchDist.current = dist;

      // Zoom toward the midpoint between the two fingers
      const canvas = canvasRef.current;
      if (canvas) {
        const rect = canvas.getBoundingClientRect();
        const scaleRatio = containerSize / rect.width; // handle CSS scaling
        const midX = ((t0.clientX + t1.clientX) / 2 - rect.left) * scaleRatio;
        const midY = ((t0.clientY + t1.clientY) / 2 - rect.top) * scaleRatio;
        setOffset(o => ({
          x: midX - (midX - o.x) * delta,
          y: midY - (midY - o.y) * delta,
        }));
      }
      setScale(s => Math.min(8, Math.max(0.1, s * delta)));
    }
  };
  const onTouchEnd = () => { lastPos.current = null; lastPinchDist.current = null; };

  // Wheel zoom toward cursor
  const onWheel = (e) => {
    e.preventDefault();
    const delta = e.deltaY < 0 ? 1.06 : 0.95;
    const canvas = canvasRef.current;
    if (canvas) {
      const rect = canvas.getBoundingClientRect();
      const scaleRatio = containerSize / rect.width;
      const mx = (e.clientX - rect.left) * scaleRatio;
      const my = (e.clientY - rect.top) * scaleRatio;
      setOffset(o => ({
        x: mx - (mx - o.x) * delta,
        y: my - (my - o.y) * delta,
      }));
    }
    setScale(s => Math.min(8, Math.max(0.1, s * delta)));
  };

  const confirmCrop = () => {
    // Render the circular crop to a clean 300x300 canvas
    const out = document.createElement("canvas");
    out.width = 300; out.height = 300;
    const ctx = out.getContext("2d");
    ctx.beginPath();
    ctx.arc(150, 150, 150, 0, Math.PI * 2);
    ctx.clip();
    const ratio = 300 / containerSize;
    ctx.drawImage(imgEl, offset.x * ratio, offset.y * ratio, imgEl.width * scale * ratio, imgEl.height * scale * ratio);
    onConfirm(out.toDataURL("image/jpeg", 0.88));
  };

  return (
    <div style={{
      position:"fixed", inset:0, zIndex:1100,
      background:"rgba(0,0,0,0.92)",
      display:"flex", flexDirection:"column", alignItems:"center", justifyContent:"center",
      padding:24,
    }}>
      <div style={{color:"#f1f5f9", fontFamily:"'DM Sans',sans-serif", fontWeight:700, fontSize:17, marginBottom:8}}>
        Crop Photo
      </div>
      <div style={{color:"#64748b", fontFamily:"'DM Mono',monospace", fontSize:11, marginBottom:20, textAlign:"center"}}>
        Drag to reposition · Pinch or scroll to zoom
      </div>

      {/* Canvas crop area */}
      <div style={{borderRadius:"50%", overflow:"hidden", boxShadow:"0 0 0 4px #7c3aed44, 0 8px 40px rgba(0,0,0,0.8)", cursor:"grab"}}>
        <canvas
          ref={canvasRef}
          width={containerSize}
          height={containerSize}
          onMouseDown={onMouseDown}
          onMouseMove={onMouseMove}
          onMouseUp={onMouseUp}
          onMouseLeave={onMouseUp}
          onTouchStart={onTouchStart}
          onTouchMove={onTouchMove}
          onTouchEnd={onTouchEnd}
          onWheel={onWheel}
          style={{display:"block", touchAction:"none"}}
        />
      </div>

      <div style={{display:"flex", gap:12, marginTop:28, width:"100%", maxWidth:300}}>
        <button onClick={onCancel} style={{
          flex:1, padding:"13px 0", borderRadius:12,
          background:"#0f172a", border:"1px solid #334155",
          color:"#64748b", fontFamily:"'DM Mono',monospace", fontSize:13, cursor:"pointer",
        }}>Cancel</button>
        <button onClick={confirmCrop} style={{
          flex:2, padding:"13px 0", borderRadius:12,
          background:"linear-gradient(135deg,#7c3aed,#6d28d9)", border:"none",
          color:"#fff", fontFamily:"'DM Sans',sans-serif", fontSize:14, fontWeight:700, cursor:"pointer",
        }}>Use Photo</button>
      </div>
    </div>
  );
}

function TeamEditModal({ addingNew, editingId, editName, setEditName, editRole, setEditRole,
  editType, setEditType, editAv, setEditAv, editPhone, setEditPhone, editActive, setEditActive,
  editPic, setEditPic, staff,
  onDismiss, onSave }) {

  const [visible, setVisible] = useState(false);
  const [cropSrc, setCropSrc] = useState(null);
  useEffect(() => { const raf = requestAnimationFrame(() => setVisible(true)); return () => cancelAnimationFrame(raf); }, []);

  const dismiss = () => { setVisible(false); setTimeout(onDismiss, 200); };
  const toggleDay = (d) => setEditAv(prev => ({ ...prev, [d]: !prev[d] }));

  const fileInputRef = React.useRef(null);

  const handlePicChange = (e) => {
    const file = e.target.files?.[0];
    if (!file) return;
    // Reset input so same file can be re-selected
    e.target.value = "";
    const reader = new FileReader();
    reader.onload = (ev) => setCropSrc(ev.target.result);
    reader.readAsDataURL(file);
  };

  // For the existing member, show their current saved pic if editPic not yet changed
  const existingMember = !addingNew && staff ? staff.find(s => s.id === editingId) : null;
  const displayPic = editPic || (existingMember?.pic) || (editingId ? PROFILE_PICS[editingId] : null);

  const inp = {
    background:"#0f172a", border:"1px solid #334155", borderRadius:8,
    padding:"10px 12px", color:"#e2e8f0", fontSize:16,
    fontFamily:"'DM Mono',monospace", outline:"none", width:"100%", appearance:"none",
  };

  if (cropSrc) return (
    <ImageCropModal
      imageSrc={cropSrc}
      onConfirm={(croppedDataUrl) => { setEditPic(croppedDataUrl); setCropSrc(null); }}
      onCancel={() => setCropSrc(null)}
    />
  );

  return (
    <div
      onClick={dismiss}
      style={{
        position:"fixed", inset:0, zIndex:999,
        background: visible ? "rgba(0,0,0,0.78)" : "rgba(0,0,0,0)",
        transition:"background .2s ease",
        display:"flex", alignItems:"center", justifyContent:"center", padding:"24px 16px",
      }}
    >
      <div
        onClick={e => e.stopPropagation()}
        style={{
          background:"#0d1117", borderRadius:20, padding:"28px 24px 24px",
          width:"100%", maxWidth:420,
          boxShadow:"0 24px 80px rgba(0,0,0,0.9)",
          transform: visible ? "scale(1) translateY(0)" : "scale(0.93) translateY(20px)",
          opacity: visible ? 1 : 0,
          transition:"transform .2s cubic-bezier(.22,1,.36,1), opacity .2s ease",
          maxHeight:"90vh", overflowY:"auto",
        }}
      >
        <div style={{display:"flex", alignItems:"center", gap:14, marginBottom:20}}>
          {/* Tappable avatar — always shown, triggers file picker */}
          <div
            onClick={() => fileInputRef.current?.click()}
            style={{position:"relative", cursor:"pointer", flexShrink:0}}
          >
            <input
              ref={fileInputRef}
              type="file"
              accept="image/*"
              onChange={handlePicChange}
              style={{display:"none"}}
            />
            {displayPic ? (
              <div style={{width:52, height:52, borderRadius:"50%", overflow:"hidden", border:"2px solid #7c3aed"}}>
                <img src={displayPic} style={{width:"100%", height:"100%", objectFit:"cover"}} />
              </div>
            ) : (
              <div style={{
                width:52, height:52, borderRadius:"50%",
                background:"#1e293b", border:"2px dashed #334155",
                display:"flex", alignItems:"center", justifyContent:"center",
              }}>
                <span style={{fontSize:22}}>📷</span>
              </div>
            )}
            {/* Edit badge */}
            <div style={{
              position:"absolute", bottom:0, right:0,
              width:18, height:18, borderRadius:"50%",
              background:"#7c3aed", border:"2px solid #0d1117",
              display:"flex", alignItems:"center", justifyContent:"center",
              fontSize:9, color:"#fff", lineHeight:1,
            }}>✎</div>
          </div>
          <div>
            <div style={{fontWeight:700, color:"#f1f5f9", fontFamily:"'DM Sans',sans-serif", fontSize:17}}>
              {addingNew ? "Add Team Member" : "Edit Team Member"}
            </div>
            <div style={{fontSize:10, color:"#475569", fontFamily:"'DM Mono',monospace", marginTop:2}}>
              Tap photo to {displayPic ? "change" : "upload"}
            </div>
          </div>
        </div>

        <div style={{display:"flex",flexDirection:"column",gap:14}}>
          {/* Name — onBlur/onKeyDown handle keyboard dismissal natively in mobile */}
          <div>
            <div style={{fontSize:10,color:"#475569",fontFamily:"'DM Mono',monospace",letterSpacing:1,marginBottom:6}}>NAME</div>
            <input
              value={editName}
              onChange={e => setEditName(e.target.value)}
              onKeyDown={e => { if(e.key==="Enter"||e.key==="Done") e.target.blur(); }}
              placeholder="Full name"
              style={inp}
              autoComplete="off"
            />
          </div>

          {/* Role — multi-chip selector with custom add */}
          <RoleChipSelector editRole={editRole} setEditRole={setEditRole} />

          {/* Type */}
          <div>
            <div style={{fontSize:10,color:"#475569",fontFamily:"'DM Mono',monospace",letterSpacing:1,marginBottom:6}}>TYPE</div>
            <div style={{display:"flex",gap:8}}>
              {["casual","fulltime"].map(t=>(
                <button key={t} onClick={()=>setEditType(t)} style={{
                  flex:1, padding:"9px 0", borderRadius:9,
                  border: editType===t ? `1px solid ${t==="fulltime"?"#059669":"#7c3aed"}` : "1px solid #1e293b",
                  background: editType===t ? (t==="fulltime"?"#052e1644":"#4c1d9544") : "#0f172a",
                  color: editType===t ? (t==="fulltime"?"#4ade80":"#a78bfa") : "#475569",
                  fontFamily:"'DM Mono',monospace", fontSize:11, cursor:"pointer",
                }}>{t==="fulltime"?"Full-time":"Casual"}</button>
              ))}
            </div>
          </div>

          {/* Phone */}
          <div>
            <div style={{fontSize:10,color:"#475569",fontFamily:"'DM Mono',monospace",letterSpacing:1,marginBottom:6}}>PHONE NUMBER</div>
            <input
              value={editPhone}
              onChange={e => setEditPhone(e.target.value)}
              onKeyDown={e => { if(e.key==="Enter"||e.key==="Done") e.target.blur(); }}
              placeholder="e.g. 0412 345 678"
              type="tel"
              style={inp}
              autoComplete="off"
            />
          </div>

          {/* Active toggle (edit only) */}
          {!addingNew && (
            <div style={{display:"flex",alignItems:"center",justifyContent:"space-between",padding:"10px 12px",background:"#0f172a",borderRadius:9,border:"1px solid #1e293b"}}>
              <div>
                <div style={{fontSize:12,color:"#e2e8f0",fontFamily:"'DM Mono',monospace"}}>Active</div>
                <div style={{fontSize:10,color:"#475569",fontFamily:"'DM Mono',monospace",marginTop:2}}>Inactive members won't appear in rosters</div>
              </div>
              <div onClick={()=>setEditActive(p=>!p)} style={{
                width:42, height:24, borderRadius:12, cursor:"pointer",
                background: editActive ? "#7c3aed" : "#1e293b",
                position:"relative", transition:"background .2s", flexShrink:0,
              }}>
                <div style={{
                  position:"absolute", top:3, left: editActive?18:3, width:18, height:18,
                  borderRadius:"50%", background:"#fff", transition:"left .2s",
                }}/>
              </div>
            </div>
          )}
        </div>

        <div style={{display:"flex",gap:10,marginTop:24}}>
          <button onClick={dismiss} style={{flex:1,padding:14,background:"#0f172a",border:"1px solid #334155",borderRadius:12,color:"#64748b",fontFamily:"'DM Mono',monospace",fontSize:13,cursor:"pointer"}}>Cancel</button>
          <button onClick={onSave} style={{flex:2,padding:14,background:"linear-gradient(135deg,#7c3aed,#6d28d9)",border:"none",borderRadius:12,color:"#fff",fontFamily:"'DM Sans',sans-serif",fontSize:14,fontWeight:700,cursor:"pointer"}}>
            {addingNew ? "Add Member" : "Save Changes"}
          </button>
        </div>
      </div>
    </div>
  );
}

// ─── TEAM SCREEN ──────────────────────────────────────────────────────────────
function TeamScreen({ staff, setStaff, onBack }) {
  const [animKey] = useState(() => Date.now());
  const [scrollProgress, setScrollProgress] = useState(0);
  const handleTeamScroll = (e) => {
    const el = e.target;
    const scrollable = el.scrollHeight - el.clientHeight;
    setScrollProgress(scrollable > 0 ? Math.min(el.scrollTop / scrollable, 1) : 0);
  };
  const [editingId, setEditingId]   = useState(null);
  const [addingNew, setAddingNew]   = useState(false);
  const [filter, setFilter]         = useState("all");

  const [editName, setEditName]     = useState("");
  const [editRole, setEditRole]     = useState("");
  const [editType, setEditType]     = useState("casual");
  const [editAv, setEditAv]         = useState({});
  const [editActive, setEditActive] = useState(true);
  const [editPhone, setEditPhone]   = useState("");
  const [editPic, setEditPic]       = useState(null);

  const openEdit = (member) => {
    setEditName(member.name);
    setEditRole(member.role);
    setEditType(member.type);
    setEditAv({ ...member.av });
    setEditActive(member.active !== false);
    setEditPhone(member.phone || "");
    setEditPic(member.pic || null);
    setEditingId(member.id);
  };

  const saveEdit = () => {
    setStaff(prev => prev.map(s => s.id === editingId
      ? { ...s, name: editName.trim(), role: editRole, type: editType, av: editAv, phone: editPhone.trim(), active: editActive, pic: editPic || s.pic || null }
      : s
    ));
    setEditingId(null);
  };

  const openAdd = () => {
    setEditName(""); setEditRole(""); setEditType("casual"); setEditAv({}); setEditPhone(""); setEditActive(true); setEditPic(null);
    setAddingNew(true);
  };

  const saveAdd = () => {
    if (!editName.trim()) return;
    const newId = Math.max(...staff.map(s=>s.id)) + 1;
    // If no availability was set, default to all 7 days available
    const DEFAULT_AV = { Mon:true, Tue:true, Wed:true, Thu:true, Fri:true, Sat:true, Sun:true };
    const av = Object.keys(editAv).length > 0 ? editAv : DEFAULT_AV;
    setStaff(prev => [...prev, { id:newId, name:editName.trim(), role:editRole, type:editType, av, phone:editPhone.trim(), active:true, pic: editPic || null }]);
    setAddingNew(false);
  };

  const handleDismiss = () => { setEditingId(null); setAddingNew(false); };
  const handleSave    = addingNew ? saveAdd : saveEdit;

  const displayed = staff
    .filter(s => filter==="all" ? true : filter==="active" ? s.active!==false : s.active===false)
    .sort((a,b) => a.name.localeCompare(b.name));

  const activeCount   = staff.filter(s=>s.active!==false).length;
  const inactiveCount = staff.filter(s=>s.active===false).length;
  const isModalOpen   = editingId !== null || addingNew;

  return (
    <div style={{height:"100vh",background:"#09090f",display:"flex",flexDirection:"column"}}>

      {/* Header */}
      <div style={{background:"#0d1117",borderBottom:"1px solid #1e293b",padding:"12px 16px",display:"flex",alignItems:"center",gap:10,flexShrink:0}}>
        <button onClick={onBack} style={{background:"#1e293b",border:"none",borderRadius:9,padding:"7px 12px",color:"#94a3b8",fontSize:16,cursor:"pointer"}}>‹</button>
        <div style={{flex:1}}>
          <div style={{fontSize:14,fontWeight:700,color:"#f1f5f9",fontFamily:"'DM Sans',sans-serif"}}>Team</div>
          <div style={{fontSize:10,color:"#475569",fontFamily:"'DM Mono',monospace"}}>{activeCount} active · {inactiveCount} inactive</div>
        </div>
        <button onClick={openAdd} style={{
          width:34,height:34,borderRadius:"50%",
          background:"linear-gradient(135deg,#7c3aed,#6d28d9)",
          border:"none",color:"#fff",fontSize:20,lineHeight:1,
          display:"flex",alignItems:"center",justifyContent:"center",cursor:"pointer",
          boxShadow:"0 4px 14px rgba(124,58,237,.4)",
        }}>+</button>
      </div>

      {/* Member list — filter tabs scroll with content */}
      <div style={{flex:1, position:"relative", overflow:"hidden"}}>
      <div onScroll={handleTeamScroll} style={{height:"100%",overflowY:"auto",padding:"12px 16px 32px",display:"flex",flexDirection:"column",gap:10}}>
        {/* Filter tabs — scrolls with list */}
        <div style={{display:"flex",gap:8,marginBottom:4,flexShrink:0}}>
          {[["all","All"],["active","Active"],["inactive","Inactive"]].map(([val,label])=>(
            <button key={val} onClick={()=>setFilter(val)} style={{
              padding:"6px 14px", borderRadius:20, fontSize:11,
              border: filter===val ? "1px solid #7c3aed" : "1px solid #1e293b",
              background: filter===val ? "#4c1d9544" : "transparent",
              color: filter===val ? "#a78bfa" : "#475569",
              fontFamily:"'DM Mono',monospace", cursor:"pointer",
            }}>{label}</button>
          ))}
        </div>
        {displayed.map((member, i) => {
          const isActive = member.active !== false;
          const isFT     = member.type === "fulltime";
          const sc       = isFT ? FT : CA;
          const lc       = isFT
            ? { bg:"#052e1622", border:`1px solid ${FT}44`, accent:FT }
            : { bg:"#1e0b4422", border:`1px solid ${CA}44`, accent:CA };
          const initials = member.name.split(" ").slice(0,2).map(w=>w[0]).join("");

          const card = (
            <div key={`${filter}-${member.id}`} style={{
              background: lc.bg,
              border: lc.border,
              borderRadius:14,
              padding:"13px 14px",
              display:"flex", alignItems:"center", gap:13,
              opacity: isActive ? 1 : 0.45,
              animation:"fadeSlideUp 0.4s ease both",
              animationDelay:`${i * 0.05}s`,
            }}>
              <Avatar name={member.name} type={member.type} size={44} staffId={member.id} picOverride={member.pic}/>
              <div style={{flex:1,minWidth:0}}>
                <div style={{fontSize:14,fontWeight:600,color: isActive ? "#f1f5f9" : "#64748b",fontFamily:"'DM Sans',sans-serif",whiteSpace:"nowrap",overflow:"hidden",textOverflow:"ellipsis"}}>
                  {member.name}
                </div>
                <div style={{fontSize:11,color:"#64748b",fontFamily:"'DM Mono',monospace",marginTop:2,display:"flex",alignItems:"center",gap:6}}>
                  <span>{member.role}</span>
                  {isFT && <span style={{color:FT,fontSize:10,fontWeight:600}}>Full-time</span>}
                  {!isActive && <span style={{color:"#ef4444",fontSize:10}}>INACTIVE</span>}
                </div>
                {member.phone && <div style={{fontSize:10,color:"#475569",fontFamily:"'DM Mono',monospace",marginTop:1}}>{member.phone}</div>}
              </div>
              <button onClick={()=>openEdit(member)} style={{
                background:"#1e293b44", border:"1px solid #334155",
                borderRadius:9, padding:"7px 14px",
                color:"#94a3b8", fontFamily:"'DM Mono',monospace",
                fontSize:11, cursor:"pointer", whiteSpace:"nowrap",
              }}>Edit</button>
            </div>
          );

          return !isActive ? (
            <SwipeToDelete
              key={`inactive-${member.id}`}
              confirmRequired={true}
              confirmMessage={`Remove ${member.name} from the team?`}
              onDelete={() => setStaff(prev => prev.filter(s => s.id !== member.id))}
            >
              {card}
            </SwipeToDelete>
          ) : card;
        })}
      </div>
        {/* Feathered fade overlay — shrinks as user scrolls down */}
        <div style={{
          position:"absolute", bottom:0, left:0, right:0,
          height:`${40 * (1 - scrollProgress)}%`,
          background:"linear-gradient(to bottom, transparent 0%, rgba(9,9,15,0.85) 60%, #09090f 100%)",
          pointerEvents:"none",
        }}/>
      </div>

      {/* Modal — hoisted component, no re-creation on keypress */}
      {isModalOpen && (
        <TeamEditModal
          addingNew={addingNew}
          editingId={editingId}
          editName={editName}      setEditName={setEditName}
          editRole={editRole}      setEditRole={setEditRole}
          editType={editType}      setEditType={setEditType}
          editAv={editAv}          setEditAv={setEditAv}
          editPhone={editPhone}    setEditPhone={setEditPhone}
          editActive={editActive}  setEditActive={setEditActive}
          editPic={editPic}        setEditPic={setEditPic}
          staff={staff}
          onDismiss={handleDismiss}
          onSave={handleSave}
        />
      )}
    </div>
  );
}

