function App() {
  const [screen, setScreen]           = useState("welcome");
  const [direction, setDirection]     = useState("forward");
  const [weekOffset, setWeekOffset]   = useState(0);
  const [selectedDay, setSelectedDay] = useState(null);
  // shiftsMap: { [weekOffset]: shift[] } — persists edits per week
  const [staff, setStaff]             = useState(INITIAL_STAFF);
  const [ftSchedule, setFtSchedule]   = useState(INITIAL_FT_SCHEDULE);
  const WEEK0_PREFILLED = WEEK0_SHIFTS;
  const [shiftsMap, setShiftsMap] = useState({ 0: WEEK0_PREFILLED });
  const [copiedWeek, setCopiedWeek]   = useState(null); // { offset, shifts[] }

  // On mount: always seed week 0 with this week's pre-filled roster
  useEffect(() => {
    setShiftsMap(prev => ({ ...prev, 0: WEEK0_PREFILLED }));
  }, []);

  useEffect(() => {
    setShiftsMap(prev => {
      if (weekOffset in prev) return prev; // already visited — preserve edits
      // Week 0 = pre-filled real roster; all other weeks = FT defaults only
      const seed = weekOffset === 0 ? WEEK0_PREFILLED : buildShifts(staff, ftSchedule);
      return { ...prev, [weekOffset]: seed };
    });
  }, [weekOffset]);

  // Derived: shifts for the current week
  const shifts = shiftsMap[weekOffset] || [];

  const setShifts = (updater) => {
    setShiftsMap(prev => {
      const current = prev[weekOffset] || [];
      const next = typeof updater === "function" ? updater(current) : updater;
      return { ...prev, [weekOffset]: next };
    });
  };

  const go = (to, dir = "forward") => {
    setDirection(dir);
    setScreen(to);
  };

  const handleStart = (offset) => {
    setWeekOffset(offset);
    // Week 0 always boots with the pre-filled real roster, other weeks get FT defaults
    setShiftsMap({ [offset]: offset === 0 ? WEEK0_PREFILLED : buildShifts(staff, ftSchedule) });
    go("generating", "forward");
  };

  const animClass = (screen === "weekview" || screen === "team" || screen === "ft") ? "" : "screen-reveal";

  return (
    <>
      <style>{`
        @import url('https://fonts.googleapis.com/css2?family=DM+Sans:wght@400;600;700&family=DM+Mono:wght@400;500&display=swap');
        *,*::before,*::after{box-sizing:border-box;margin:0;padding:0;}
        html,body{height:100%;background:#09090f;-webkit-font-smoothing:antialiased;}
      @keyframes fadeSlideUp {
        from { opacity: 0; transform: translateY(18px); }
        to   { opacity: 1; transform: translateY(0); }
      }
        button{cursor:pointer;}
        @media print {
          body { background:#fff !important; -webkit-print-color-adjust:exact; print-color-adjust:exact; }
          .no-print { display:none !important; }
          .print-roster { display:block !important; }
        }
        .print-roster { display:none; }
        select option{background:#0f172a;}
        ::-webkit-scrollbar{width:3px;height:3px;}
        ::-webkit-scrollbar-thumb{background:#1e293b;border-radius:4px;}

        @keyframes wave {
          0%,100%{ transform:rotate(0deg); }
          20%    { transform:rotate(25deg); }
          40%    { transform:rotate(-10deg); }
          60%    { transform:rotate(20deg); }
          80%    { transform:rotate(-5deg); }
        }
        .wave-hand { display:inline-block; transform-origin:70% 70%; animation: wave 1.6s ease-in-out 0.6s 2; }
        @keyframes screenReveal {
          from { opacity:0; transform: translateY(18px); }
          to   { opacity:1; transform: translateY(0); }
        }
        .screen-reveal { animation: screenReveal .32s cubic-bezier(.22,1,.36,1) both; }
      `}</style>

      <div key={screen} className={animClass} style={{height:"100%"}}>
        {screen==="welcome"    && <WelcomeScreen onStart={handleStart}/>}
        {screen==="generating" && <GeneratingScreen onDone={()=>go("dayhub","forward")}/>}
        {screen==="dayhub"     && (
          <DayHubScreen
            weekOffset={weekOffset}
            setWeekOffset={setWeekOffset}
            onDayTap={d=>{ setSelectedDay(d); go("day","forward"); }}
            onViewTeam={()=>go("team","forward")}
            onViewWeek={()=>go("weekview","forward")}
            onPublish={()=>go("publish","forward")}
            onViewFT={()=>go("ft","forward")}
            shifts={shifts}
            setShifts={setShifts}
            staff={staff}
            ftSchedule={ftSchedule}
          />
        )}
        {screen==="ft" && <FullTimersScreen ftSchedule={ftSchedule} setFtSchedule={setFtSchedule} staff={staff} onBack={()=>go("dayhub","back")}/>}
        {screen==="overview"   && (
          <OverviewScreen
            shifts={shifts} weekOffset={weekOffset} setWeekOffset={setWeekOffset}
            onDayTap={d=>{ setSelectedDay(d); go("day","forward"); }}
            staff={staff}
            onViewTeam={()=>go("team","forward")}
            onViewWeek={()=>go("weekview","forward")}
            onPublish={()=>go("publish","forward")}
          />
        )}
        {screen==="day" && (
          <DayScreen
            dayShort={selectedDay} shifts={shifts} setShifts={setShifts}
            weekOffset={weekOffset} staff={staff} ftSchedule={ftSchedule} onBack={()=>go("dayhub","back")}
          />
        )}
        {screen==="weekview" && <WeekViewScreen shifts={shifts} setShifts={setShifts} weekOffset={weekOffset} setWeekOffset={setWeekOffset} shiftsMap={shiftsMap} setShiftsMap={setShiftsMap} staff={staff} ftSchedule={ftSchedule} onBack={()=>go("dayhub","back")} copiedWeek={copiedWeek} setCopiedWeek={setCopiedWeek}/>}
        {screen==="team"     && <TeamScreen staff={staff} setStaff={setStaff} onBack={()=>go("dayhub","back")}/>}
        {screen==="publish"  && (
          <PublishScreen
            shifts={shifts} weekOffset={weekOffset}
            onBack={()=>go("dayhub","back")}
            onReset={()=>{ setShiftsMap({0:WEEK0_PREFILLED}); setWeekOffset(0); go("welcome","back"); }}
          />
        )}
      </div>
    </>
  );

}

export default App;
